def count_unique_elements(iterable):
    """Count unique elements in the iterable using a frozenset."""
    unique_elements = frozenset(iterable)
    return len(unique_elements)

def create_dict_from_lists(keys, values):
    """Create a dictionary from two lists, assuming equal lengths."""
    return dict(zip(keys, values))

def main():
    # Example usage of count_unique_elements
    elements = [1, 2, 2, 3, 4, 4, 4, 5]
